function DrawZones()
	for _,dat in pairs(Zones) do
		local r,g,b = math.random(0,255), math.random(0,255), math.random(0,255)
		for _, v in pairs(dat) do
			v[2] = v[2] + MapOffset[1]
			v[3] = v[3] + MapOffset[2]
			
			v[4] = v[4] + MapOffset[1]
			v[5] = v[5] + MapOffset[2]
			
			local area = createRadarArea(v[2],v[3],v[4]-v[2],v[5]-v[3], r,g,b)
			setElementDimension(area, 2)
		end
	end
end


function GetZoneName(x,y, citiesonly)
	for name,dat in pairs(Zones) do
		for _, v in pairs(dat) do
			if(x > v[2] and x < v[4]) then
				if(y > v[3] and y < v[5]) then
					if(citiesonly) then return name else return v[1] end
				end
			end
		end
	end
	return "Unknown"
end







local identityMatrix = {
	[1] = {1, 0, 0},
	[2] = {0, 1, 0},
	[3] = {0, 0, 1}
}

 
function QuaternionTo3x3(x,y,z,w)
	local matrix3x3 = {[1] = {}, [2] = {}, [3] = {}}
 
	local symetricalMatrix = {
		[1] = {(-(y*y)-(z*z)), x*y, x*z},
		[2] = {x*y, (-(x*x)-(z*z)), y*z},
		[3] = {x*z, y*z, (-(x*x)-(y*y))} 
	}

	local antiSymetricalMatrix = {
		[1] = {0, -z, y},
		[2] = {z, 0, -x},
		[3] = {-y, x, 0}
	}
 
	for i = 1, 3 do 
		for j = 1, 3 do
			matrix3x3[i][j] = identityMatrix[i][j]+(2*symetricalMatrix[i][j])+(2*w*antiSymetricalMatrix[i][j])
		end
	end
	
	return matrix3x3
end




function getEulerAnglesFromMatrix(x1,y1,z1,x2,y2,z2,x3,y3,z3)
	local nz1,nz2,nz3
	nz3 = math.sqrt(x2*x2+y2*y2)
	nz1 = -x2*z2/nz3
	nz2 = -y2*z2/nz3
	local vx = nz1*x1+nz2*y1+nz3*z1
	local vz = nz1*x3+nz2*y3+nz3*z3
	return math.deg(math.asin(z2)),-math.deg(math.atan2(vx,vz)),-math.deg(math.atan2(x2,y2))
end





function fromQuaternion(x,y,z,w) 
	local matrix = QuaternionTo3x3(x,y,z,w)
	local ox,oy,oz = getEulerAnglesFromMatrix(
		matrix[1][1], matrix[1][2], matrix[1][3], 
		matrix[2][1], matrix[2][2], matrix[2][3],
		matrix[3][1], matrix[3][2], matrix[3][3]
	)

	return ox,oy,oz
end




local x,y,_ = getElementPosition(localPlayer)
local ReplaceModel = {}
local LoadedTxd = {}

function GetFreeModelIds(forid)
	if(not ReplaceModel[forid]) then
		local out = FreeIds[#FreeIds]
		ReplaceModel[forid] = out
		table.remove(FreeIds, #FreeIds)
		
		
		if(fileExists("vc/"..forid..".col")) then
			col_floors = engineLoadCOL("vc/"..forid..".col")
			engineReplaceCOL(col_floors, ReplaceModel[forid])
		end
		
		
		local texture = Textures[forid..".dff"]
		if(texture) then 
			if(not LoadedTxd[texture]) then
				LoadedTxd[texture] = engineLoadTXD("vc/"..texture)
				engineImportTXD(LoadedTxd[texture], ReplaceModel[forid])
			else
				engineImportTXD(LoadedTxd[texture], ReplaceModel[forid])
			end
		end
		
		
		dff = engineLoadDFF("vc/"..forid..".dff")
		engineReplaceModel(dff, ReplaceModel[forid])
	end
	return ReplaceModel[forid]
end




local screenWidth, screenHeight = guiGetScreenSize()
local scale = ((screenWidth/1920)+(screenHeight/1080))
local Loading = 0
local FullLoading = false
local DownloadNext = true
local DownloadList = {}
function DrawOnClientRender()
	if(Loading) then
		if(DownloadNext) then
			DownloadNext = false
			downloadFile(DownloadList[1])
		end
		dxDrawRectangle(100*scale, screenHeight-(100*scale),screenWidth-(200*scale), 15*scale, tocolor(240, 149, 171,255))
		dxDrawRectangle(100*scale, screenHeight-(100*scale),(screenWidth-(200*scale))*(Loading/100), 15*scale, tocolor(243, 174, 193,255))
	end
end



function CheckFiles(arr)	
	local newarr = {}
	for _, i in ipairs(arr) do
		if(not fileExists(i)) then
			table.insert(newarr, i)
		end
	end
	if(#newarr > 0) then
		DownloadList = newarr
		FullLoading = #DownloadList
		addEventHandler("onClientRender", root, DrawOnClientRender)
	else
		AllDownloadCompleted()
	end
end
addEvent("CheckFiles", true)
addEventHandler("CheckFiles", localPlayer, CheckFiles)



function AllDownloadCompleted()		
	for i, v in pairs(GTAVCSource) do
		v[3] = v[3] + MapOffset[1]
		v[4] = v[4] + MapOffset[2]
		v[5] = v[5] + MapOffset[3]
		if(engineGetModelNameFromID(v[1])) then 
			NativeModel[v[1]] = true 
			local rx,ry,rz = fromQuaternion(v[6],v[7],v[8],v[9])
			GTAVCSource[i][11] = createObject(v[1],v[3],v[4],v[5], rx,ry,rz)
			setElementDimension(GTAVCSource[i][11], 2)
		else
			table.insert(GTAVC, v)
		end
	end


	for _, dat in pairs(BannedFreeIdsSource) do
		for _, v in ipairs(dat) do
			BannedFreeIds[v] = true
		end
	end 
	
	for _, v in pairs(FreeIdsSource) do
		if(not NativeModel[v] and not BannedFreeIds[v]) then 
			table.insert(FreeIds, v)
		end
	end
	
	
	for i = 550, 20000 do
		removeWorldModel(i,10000,0,0,0)
	end
	setWaterLevel(-5000)
	setOcclusionsEnabled(false)
	triggerServerEvent("CheckEnd", localPlayer, localPlayer)
	
	addEventHandler("onClientRender", root, GenerateMapPreRender)	

	setWeather(1)
	setFogDistance(1000)
	setFarClipDistance(3000)
	setRainLevel(0)
	setSkyGradient(30,117,210, 53,162,227)
	setCloudsEnabled(false)
	setGameSpeed(0)
end

function onDownloadFinish(file, success)
    if(source == resourceRoot) then
        if(success) then
			table.remove(DownloadList, 1)
			Loading = (FullLoading-#DownloadList)/FullLoading*100
			if(#DownloadList == 0) then
				removeEventHandler("onClientRender", root, DrawOnClientRender)	
				AllDownloadCompleted()
			else
				DownloadNext = true
			end
        end
    end
end
addEventHandler("onClientFileDownloadComplete", root, onDownloadFinish)





function getMaxIndex(arr)
	local ii = 0
	for i,_ in pairs(arr) do 
		if(i > ii) then
			ii=i
		end
	end
	return ii
end

local TotalObjects = getMaxIndex(GTAVC)
local ind = 1
local Loading2 = 0
function GenerateMapPreRender()
	if(GTAVC[ind]) then 
		local v = GTAVC[ind]
		local lodname = false
		local model = v[1]
		if(not NativeModel[v[1]]) then	
			model = GetFreeModelIds(v[2])			
			
			lodname = 'lod'..string.sub(v[2], 4)
			if(not Textures[lodname..".dff"]) then lodname = false end
		end
		
		local rx,ry,rz = fromQuaternion(v[6],v[7],v[8],v[9])
		GTAVC[ind][11] = createObject(model,v[3],v[4],v[5], rx,ry,rz)
		if(isElement(GTAVC[ind][11])) then
			if(not v[10]) then v[10] = 300 end
			if(v[10] == -1) then 
				v[10] = 300 
			elseif(v[10] <= 150) then 
				v[10] = 150 
			end
			engineSetModelLODDistance(model, v[10])
			setElementDimension(GTAVC[ind][11], 2)
			
			if((ind/2000) == math.floor(ind/2000) or ind == 1) then -- Менять кадр каждые 2000 объектов
				setCameraMatrix(v[3]+150,v[4]+150,v[5]+150, v[3],v[4],v[5]+50)
				setWeather(1)
				setFogDistance(1000)
				setFarClipDistance(3000)
				setRainLevel(0)
				setSkyGradient(30,117,210, 53,162,227)
				setCloudsEnabled(false)
			end
			
			if(lodname) then
				local lodmodel = GetFreeModelIds(lodname)
				
				GTAVC[ind][12] = createObject(lodmodel,v[3],v[4],v[5], rx,ry,rz, true)
				setElementDimension(GTAVC[ind][12], 2)
				
				setLowLODElement(GTAVC[ind][12], false)
				setLowLODElement(GTAVC[ind][11], GTAVC[ind][12])
				engineSetModelLODDistance(lodmodel, 300)
			else
				setLowLODElement(GTAVC[ind][11], false)
			end
		end
		ind = ind+1
		
	else
		if(ind < TotalObjects) then
			ind = ind + 1
		else
			setGameSpeed(1.2)
			triggerServerEvent("Go_LC", localPlayer, localPlayer)
			DrawZones()
			removeEventHandler("onClientRender", root, GenerateMapPreRender)
		end
	end
	Loading2 = (#GTAVC-(#GTAVC-ind))/#GTAVC*100
	dxDrawRectangle(100*scale, screenHeight-(100*scale),screenWidth-(200*scale), 15*scale, tocolor(11,102,198,255))
	dxDrawRectangle(100*scale, screenHeight-(100*scale),(screenWidth-(200*scale))*(Loading2/100), 15*scale, tocolor(12,168,253,255))
end

